// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

contract KwikTrustMarketplace is ReentrancyGuardUpgradeable, OwnableUpgradeable, AccessControlUpgradeable {
  // AccessControl
  bytes32 public constant TRANSFER_ROLE = keccak256("TRANSFER_ROLE");

  // token listed NFT in marketplace
  uint256 public itemCount;

  // struct
  struct Item {
    uint256 tokenId;
    IERC20 token;
    uint256 price;
    address tokenAddress;
    address payable owner;
  }

  mapping(uint256 => mapping(address => Item)) public items;

  // events
  event OfferedSingle(uint256 itemId, uint256 tokenId, address tokenAddress, uint256 price, address indexed owner);

  event OfferedMultiple(uint256 itemId, uint256[] tokenId, address tokenAddress, uint256 price, address indexed owner);

  event Bought(
    uint256 itemId,
    uint256 tokenId,
    address tokenAddress,
    uint256 price,
    address indexed owner,
    address indexed buyer
  );

  event TransferSingleNft(address _to, uint256 _tokenId, address tokenAddress);
  event TransferMultipleNft(address _to, uint256[] _tokenId, address tokenAddress);
  event DeList(address _to, uint256 _tokenId, address tokenAddress);
  event DeListBulk(address _to, uint256[] _tokenId, address tokenAddress);

  // bidding declarations
  uint256 public biddingItems;

  struct AuctionItem {
    uint256 tokenId;
    address tokenAddress;
    IERC20 token;
    address payable owner;
    uint256 askingPrice;
    address highestBidder;
    uint256 endTime;
  }

  mapping(uint256 => mapping(address => AuctionItem)) public itemsForAuction;
  mapping(address => mapping(uint256 => bool)) public activeItems;

  event ItemAdded(uint256 id, uint256 tokenId, address tokenAddress, uint256 askingPrice);
  event BidClaimed(uint256 id, address buyer, uint256 askingPrice);
  event HighBidder(address _highestBidder, uint256 _price);

  /**
   * @dev Upgradable initializer
   */

  function __KwikTrustMarketplace_init() external initializer {
    __ReentrancyGuard_init();
    __AccessControl_init();
    _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
  }

  /**
   * @dev list NFT in marketplace
   * @param _tokenId token id to be listed
   * @param _price listing price of token
   * Required Statements
   *  - 0x01: Price must be greater than 0
   */

  function makeItem(
    IERC20 _token,
    uint256 _tokenId,
    address _nftAddress,
    uint256 _price
  ) external nonReentrant {
    require(_price > 0, "0x01");
    // increment item count
    itemCount++;
    // transfer nft
    IERC721(_nftAddress).transferFrom(msg.sender, address(this), _tokenId);
    // add new item to items mapping
    items[_tokenId][_nftAddress] = Item(_tokenId, _token, _price, _nftAddress, payable(msg.sender));
    // emit Offered event
    emit OfferedSingle(itemCount, _tokenId, _nftAddress, _price, msg.sender);
  }

  /**
   * @dev list multiple NFTs in marketplace
   * @param _nftAddress minting contract address
   * @param _tokenId array of token ids to be listed
   * @param _price listing price of token
   * Required Statements
   *  - 0x02: Price must be greater than 0
   */

  function makeItemBulk(
    IERC20 _token,
    uint256[] memory _tokenId,
    address _nftAddress,
    uint256 _price
  ) external nonReentrant {
    require(_price > 0, "0x02");
    for (uint256 i = 0; i < _tokenId.length; i++) {
      // increment item count
      itemCount++;
      // transfer nft
      IERC721(_nftAddress).transferFrom(msg.sender, address(this), _tokenId[i]);

      // add new item to items mapping
      items[_tokenId[i]][_nftAddress] = Item(_tokenId[i], _token, _price, _nftAddress, payable(msg.sender));
    }
    emit OfferedMultiple(itemCount, _tokenId, _nftAddress, _price, msg.sender);
  }

  /**
   * @dev purchase NFT from marketplace
   * @param _itemId NFT token id
   * @param _nftAddress NFT Contract Adress
   * Required Statements
   *  - 0x03: Item Count Must be Greater than or Equal to _itemId
   *  - 0x04: _amount Must be Must be Greater than or Equal to itemPrice
   */

  function purchaseItem(
    uint256 _itemId,
    address _nftAddress,
    uint256 _amount
  ) external nonReentrant {
    Item memory item = items[_itemId][_nftAddress];
    uint256 _totalPrice = item.price;
    require(_itemId > 0 && _itemId <= itemCount, "0x03");
    require(_amount >= _totalPrice, "0x04");
    item.token.transferFrom(msg.sender, item.owner, _totalPrice);
    // transfer nft to buyer
    IERC721(_nftAddress).transferFrom(address(this), msg.sender, item.tokenId);

    // decrement item count
    itemCount--;
    // delete item from marketplace
    delete items[_itemId][_nftAddress];
    // emit Bought event
    emit Bought(_itemId, item.tokenId, _nftAddress, item.price, item.owner, msg.sender);
  }

  /**
   * @dev transfer multiple NFTs
   * @param _to reciever's address
   * @param _tokenIDs token ids to be sent
   */

  function transferNftBunch(
    address _to,
    uint256[] memory _tokenIDs,
    address _nftAddress
  ) public onlyRole(TRANSFER_ROLE) {
    for (uint256 i = 0; i < _tokenIDs.length; i++) {
      //Item memory item = items[_tokenIDs[i]][_nftAddress];
      IERC721(_nftAddress).safeTransferFrom(address(this), _to, _tokenIDs[i]);
      delete items[_tokenIDs[i]][_nftAddress];
    }
    emit TransferMultipleNft(_to, _tokenIDs, _nftAddress);
  }

  /**
   * @dev transfer single NFT
   * @param _to reciever's address
   * @param _tokenID token ids to be sent
   */

  function transferNft(
    address _to,
    uint256 _tokenID,
    address _nftAddress
  ) public onlyRole(TRANSFER_ROLE) {
    Item memory item = items[_tokenID][_nftAddress];
    IERC721(item.tokenAddress).safeTransferFrom(address(this), _to, _tokenID);
    delete items[_tokenID][_nftAddress];
    emit TransferSingleNft(_to, _tokenID, _nftAddress);
  }

  /**
   * @dev De-list single NFT from martketplace
   * @param _tokenId NFT tokenId to be delisted
   * @param _nftAddress NFT Minting address
   * Required Statements
   *  - 0x05: Caller Must be Owner of Item
   */

  function deListNft(uint256 _tokenId, address _nftAddress) external nonReentrant {
    require(items[_tokenId][_nftAddress].owner == msg.sender, "0x05");
    IERC721(_nftAddress).transferFrom(address(this), items[_tokenId][_nftAddress].owner, _tokenId);
    delete items[_tokenId][_nftAddress];
    emit DeList(msg.sender, _tokenId, _nftAddress);
  }

  /**
   * @dev De-list Bulk NFT from martketplace
   * @param _tokenId's of NFT tokenId to be delisted
   * @param _nftAddress NFT Minting address
   * Required Statements
   *  - 0x06: Caller Must be Owner of Item
   */

  function deListBulkNft(uint256[] calldata _tokenId, address _nftAddress) external nonReentrant {
    for (uint256 i = 0; i < _tokenId.length; i++) {
      require(items[_tokenId[i]][_nftAddress].owner == msg.sender, "0x06");
      IERC721(_nftAddress).transferFrom(address(this), items[_tokenId[i]][_nftAddress].owner, _tokenId[i]);
      delete items[_tokenId[i]][_nftAddress];
    }
    emit DeListBulk(msg.sender, _tokenId, _nftAddress);
  }

  /**
   * @dev listing an item for bidding
   * @param _tokenId Token Id of NFT
   * @param _nftAddress Contract address of NFT
   * @param _askingPrice mininum price of bidding
   * @param _time ending time of an auction
   * @param _token ERC20 token address
   * Required Statements
   *  - 0x07: _asking Price must be greater than 0
   *  - 0x08: _time must be greater than Current Time(block.timestamp)
   */

  function addItemToBid(
    uint256 _tokenId,
    address _nftAddress,
    uint256 _askingPrice,
    uint256 _time,
    IERC20 _token
  ) external nonReentrant returns (uint256) {
    require(_askingPrice > 0, "0x07");
    require(block.timestamp < _time, "0x08");

    itemsForAuction[_tokenId][_nftAddress] = AuctionItem(
      _tokenId,
      _nftAddress,
      _token,
      payable(msg.sender),
      _askingPrice,
      address(0),
      _time
    );
    assert(itemsForAuction[_tokenId][_nftAddress].tokenId == _tokenId);
    activeItems[_nftAddress][_tokenId] = true;
    IERC721(_nftAddress).transferFrom(msg.sender, address(this), _tokenId);
    biddingItems++;
    emit ItemAdded(_tokenId, _tokenId, _nftAddress, _askingPrice);
    return (_tokenId);
  }

  /***
   * @dev placing bid for token
   * @param _tokenId Token Id of NFT
   * @param _nftAddress Contract address of NFT
   * @param _amount  Amount enter by user
   * Required Statements
   *  - 0x09: EndTime Should be Greater than Current Time
   *  - 0x10: BidPrice Must be Greater than Asking Price
   */

  function placeBid(
    uint256 _tokenId,
    address _nftAddress,
    uint256 _amount
  ) public {
    require(block.timestamp < itemsForAuction[_tokenId][_nftAddress].endTime, "0x09");
    require(itemsForAuction[_tokenId][_nftAddress].askingPrice < _amount, "0x10");

    itemsForAuction[_tokenId][_nftAddress].token.transferFrom(_msgSender(), address(this), _amount);
    itemsForAuction[_tokenId][_nftAddress].highestBidder = msg.sender;
    itemsForAuction[_tokenId][_nftAddress].askingPrice = _amount;
    if (itemsForAuction[_tokenId][_nftAddress].highestBidder != address(0)) {
      itemsForAuction[_tokenId][_nftAddress].token.transfer(
        itemsForAuction[_tokenId][_nftAddress].highestBidder,
        itemsForAuction[_tokenId][_nftAddress].askingPrice
      );
    }
    emit HighBidder(msg.sender, _amount);
  }

  /***
   * @dev claim Token
   * @param _tokenId Token Id of NFT
   * @param _nftAddress Contract address of NFT
   * Required Statements
   *  - 0x11: CurrentTime Should be Greater than End Time
   *  - 0x12: Caller Must be Equal to Highest Bidder or Token Owner
   */

  function claimToken(uint256 _tokenId, address _nftAddress) external nonReentrant {
    require(block.timestamp > itemsForAuction[_tokenId][_nftAddress].endTime, "0x11");
    require(
      _msgSender() == itemsForAuction[_tokenId][_nftAddress].highestBidder ||
        _msgSender() == itemsForAuction[_tokenId][_nftAddress].owner,
      "0x12"
    );
    activeItems[itemsForAuction[_tokenId][_nftAddress].tokenAddress][
      itemsForAuction[_tokenId][_nftAddress].tokenId
    ] = false;
    IERC721(itemsForAuction[_tokenId][_nftAddress].tokenAddress).transferFrom(
      address(this),
      itemsForAuction[_tokenId][_nftAddress].highestBidder,
      itemsForAuction[_tokenId][_nftAddress].tokenId
    );
    itemsForAuction[_tokenId][_nftAddress].token.transfer(
      itemsForAuction[_tokenId][_nftAddress].owner,
      itemsForAuction[_tokenId][_nftAddress].askingPrice
    );
    delete itemsForAuction[_tokenId][_nftAddress];
    biddingItems--;
    emit BidClaimed(_tokenId, msg.sender, itemsForAuction[_tokenId][_nftAddress].askingPrice);
  }
}

